    {
        PIMAGE_IMPORT_DESCRIPTOR importDescriptor = NULL;
        if (!ReadProcessMemory(process, (PVOID)(currentModule->Blink + 4) + imageBaseAddress, &importDescriptor, sizeof(IMAGE_IMPORT_DESCRIPTOR), &imageSize))
