  flex-wrap: wrap;
  justify-content: space-between;
}

.column {
  width: 50%;
  order: 1;
}

@media (min-width: 768px) {
  .container {
    flex-direction: column;
  }

  .column {
    height: 100vh;
    width: 100%;
    order: 2;
  }
}

\/* Additional styles for your layout and elements *\/
.headline {
  font-size: 2rem;
  text-align: center;
}

.subheading {
  font-size: 1.5rem;
  text-align: center;
}

.image-container {
  height: auto;
  width: 100%;
  object-fit: contain;
}

\/* Add your specific styles for different screen sizes using media queries *\/
```
This CSS file sets up a basic responsive layout with a container that wraps its content when the screen width is limited. When the screen width is larger than 768px, the container switches to a column layout, and the content flows vertically.

You can add your own styles for different elements and adjust the layout and responsiveness as needed.

